import './css/App.css';
import React from 'react';


class App extends React.Component {
  constructor(props){
  super(props);
  this.state={
    usuario: true
  }
  }

  render(){
    return (
      this.usuario ? <div>Hola</div> : <div>Chau</div>
    );  
  } 
}


export default App;
